import React from 'react';
import './App.css';

import Header from './Header'
import Footer from './Footer'

import 'bootstrap/dist/css/bootstrap.min.css';

import 'react-toastify/dist/ReactToastify.css';
import Example from './example';

function App() {
  return (
    <div className="App">
      <h1> KAZI</h1>

      <Header title="1st head" />
      <Header title="2st head" />
      <Header title="3st head" />
      <Header title="last head" />
      <Footer name="kazi" />

      <Example/>
    </div>
  );
}

export default App;
